import React from 'react';

const Navbar = ({ setCurrentPage }) => {
    return (
        <nav style={{ display: 'flex', justifyContent: 'center', background: 'none' }}>
            <ul style={{ listStyleType: 'none', display: 'flex', padding: '0', margin: '0' }}>
                <li style={{ marginRight: '20px' }}>
                    <button
                        onClick={() => setCurrentPage('calendar')}
                        style={{
                            padding: '10px 20px',
                            borderRadius: '5px',
                            border: 'none',
                            backgroundColor: '#4CAF50',
                            color: '#fff',
                            cursor: 'pointer',
                        }}
                    >
                        Add Entry
                    </button>
                </li>
                <li>
                    <button
                        onClick={() => setCurrentPage('viewdata')}
                        style={{
                            padding: '10px 20px',
                            borderRadius: '5px',
                            border: 'none',
                            backgroundColor: '#4CAF50',
                            color: '#fff',
                            cursor: 'pointer',
                            size:'500px'
                        }}
                    >
                        View Timeline
                    </button>
                </li>
            </ul>
        </nav>
    );
};

export default Navbar;
